import jsPDF from 'jspdf';

export const addFonts = (doc: jsPDF) => {
  let font =
    '';
  doc.addFileToVFS('ProximaNova-Regular-normal.ttf', font);
  doc.addFont('ProximaNova-Regular-normal.ttf', 'ProximaNova-Regular', 'normal');

  font =
    '';

  doc.addFileToVFS('ProximaNova-Bold-bold.ttf', font);
  doc.addFont('ProximaNova-Bold-bold.ttf', 'ProximaNova-Bold', 'bold');
};

export default addFonts;
